import styled from 'styled-components';

export const HeaderProfileContainer = styled.div`
  background: var(--base-gray);
  min-height: 200px;
  position: fixed;
  width: 100%;
  z-index: 10;
  display: flex;
  align-items: center;
`;

export const GridContainer = styled.div`
  height: 100%;
  width: 100%;
  margin: auto;
`;

export const TitleContainer = styled.span`
  display: block;
  font-family: 'Gilroy-Bold';
  text-align: center;
  font-size: 24px;
  color: var(--primary-green);
`;

export const SubtitleContainer = styled.span`
  display: block;
  font-family: 'Gilroy-SemiBold';
  text-align: center;
  font-size: 14px;
  color: var(--base-gray-light);
`;

export const BronzeFlag = styled.img`
  width: 240px;
  height: auto;
`;

export const FlagContainer = styled.div`
  position: relative;
  height: 100%:
  width: 100%;
`;

export const Capacete2 = styled.img`
  width: -webkit-fill-available;
  height: auto;
  position: absolute;
  bottom: -53px;
  right: 24px;
`;

export const Capacete1 = styled.img`
  width: 240px;
  height: auto;
  position: absolute;
  top: -140px;
  left: 120px;
`;

export const MenuIconContainer = styled.img`
  width: 24px;
  position: absolute;
  left: 16px;
  top: 10px;
  cursor: pointer;
`;
